INSERT INTO `comments` VALUES (1, '2019-04-05 10:57:13', '新鲜，好吃', 0, 0, 1, 0, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (2, '2019-04-05 10:57:23', '很新鲜很甜的大樱桃，很快被家人一抢而空，吃完了想要再来一箱，才想起来该好好评价一下哈哈，客服态度也很好，很周到到位。开心的一次购物', 0, 0, 8, 0, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (3, '2019-04-05 10:57:33', '包装很严实，外纸箱、泡沫、内纸箱，颗粒也大，很脆很甜。份量到了。只有个别坏果，联系客服后立刻办理赔付，速度很快服务好。还会再来', 0, 0, 10, 0, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (4, '2019-04-05 10:57:43', '顺丰发过来，一天就收到了，味道很甜也很新鲜，满意', 0, 0, 13, 0, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (5, '2019-04-05 12:37:15', '你说的对', 1, 1, 12, 1, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (6, '2019-04-05 14:11:09', '我也赞同', 1, 5, 6, 12, '09d8fabb37ba488aa54f7baf48a33755');
INSERT INTO `comments` VALUES (7, '2019-03-05 10:57:13', '刚到货立马打开吃了！一个箱子里四个，个头都挺大的！好不好，看照片就知道的！超有食欲！孩子特别爱吃！一口气吃了一个！冬天太冷了，也不愿意出门，在家就可以吃到水果，真好！京东快递真是快！大早上就给我送来了！感谢感谢', 0, 0, 14, 0, '22fece1309b547069fedb8bfd4a9a855');
INSERT INTO `comments` VALUES (8, '2019-03-15 10:57:23', '越南红心火龙果 原箱装 大果 总重6kg以上（9-12个）单果约430-600g 年货礼盒 新鲜水果，火龙果很新鲜，很大一个，很甜，很好吃，包装精美，经济实惠，相信京东越做越好，生意红红火火。', 0, 0, 13, 0, '22fece1309b547069fedb8bfd4a9a855');
INSERT INTO `comments` VALUES (9, '2019-04-02 10:57:33', '水果很新鲜，当天就给宝宝做了猪猪包\r\n好可爱哦(⊙o⊙)哦', 0, 0, 11, 0, '22fece1309b547069fedb8bfd4a9a855');
INSERT INTO `comments` VALUES (10, '2019-02-27 10:57:43', '买来榨果汁的。首先，什么都好，很新鲜，送货上门也很快。其次就是太小了，拿我的手进行对比照的。不过在什么都贵的北京，能吃上火龙果也不容易。。。。减肥果汁，火龙果香蕉?汁你值得拥有。。。。。。。。。', 0, 0, 10, 0, '22fece1309b547069fedb8bfd4a9a855');
